response:
\boxed{1940} 

Açıklama: Toplam 14 üyeden (8 Cumhuriyetçi + 6 Demokrat) 5 üye seçilir. Tüm seçim sayısı C(14,5)’dir. Sadece Cumhuriyetçi veya sadece Demokrat üye seçilen durumları çıkarmamız gerekmektedir. Sadece Cumhuriyetçi seçilenlerin sayısı C(8,5) ve sadece Demokrat seçilenlerin sayısı C(6,5)’dir. Böylece istenen seçim sayısı:

C(14,5) - C(8,5) - C(6,5) = 2002 - 56 - 6 = 1940.
